import React from 'react';
import Rocket from './Rocket';

const Header = () => (
    <div className="header">
        <div className="header__content">
        <h1>Jonathan Carr</h1>
        <p>
            I create websites to justify my true passion - 
            <br />
            buying web domains
        </p>
        </div>

    </div>
)

export default Header;
